USE STRAES_XM;

DROP TABLE [old].[contato];

CREATE TABLE [old].[contato] (
	idcontato int,
	matricula int,
	nomecompleto varchar(50),
	dt_nascimento date,
	identidade varchar(20),
	orgaoexpedidor varchar(7),
	cpf varchar(20),
	tituloeleitoral varchar(15),
	celular varchar(13),
	telefone varchar(13),
	email varchar(100),
	situacao varchar(15) );


